import React from 'react'
//import axios from 'axios'
import { useEffect,useState } from 'react'

function App() {

  const [count,setCount] = useState(0)
  useEffect(()=>{
    console.log("Use effect activated");
    return
  }
  )

  const updateCount=()=>{
    setCount(count + 1)
  }

  return (
    <div>
      <button onClick={updateCount}>update count</button>
      <p>{count}</p>
    </div>
  )
}

export default App
